import React from 'react'
import styled from 'styled-components';

function Account() {
    return (
        <Container>
            <ContentAccount>
                Your Account
            </ContentAccount>
            <ContentAccountDiv>1</ContentAccountDiv>
            <ContentAccountDiv>2</ContentAccountDiv>
            <ContentAccountDiv>3</ContentAccountDiv>
        </Container>
    )
}

export default Account

const Container = styled.div`
    display: flex;
    align-items: center;
    justify-content: center;
    background-color: orange;
    margin-top: 20px;
    flex-direction: column;
`
const ContentAccount = styled.div`
    margin-left:-30%;
    font-size:30px;
`

const ContentAccountDiv = styled.div`
    background-color: red;
    width:70%;
`
